import { useState, useEffect } from "react";

function Table(res){
    const [tableData, setTableData] = useState()

    const [page, setPage] = useState(1)


    useEffect(() => {


        setTableData(res.data);
        console.log(tableData)

    }, [])
    function handleClick(){

        setPage(page +1)
    }
    return(
        <div>

                {
                    tableData[0] ? tableData.map(tableData =>
                         <div key={tableData.id}>{tableData.title}</div>) : console.log("error")
                }

        <p>{page}</p>
        <button onClick={handleClick}>see recipes</button>
        </div>
    )
}


export default Table;
